import React from 'react'
import { Helmet } from 'react-helmet'

const Meta = ({ title, description, keywords }) => {
    return (
        <Helmet>
        <title>{title}</title>
        <meta name='description' content={description} />
        <meta name='keyword' content={keywords} />
        </Helmet>
    )
}

Meta.defaultProps = {
    title: 'Welcome To Concept Store',
    description: 'We sell the best timeless luxury furniture',
    keywords: 'concept furniture, minimalistic furniture, stylish furniture, minimalist',
}

export default Meta
